import React from "react";
import Heading from "./Heading";
import logo from "./logo.svg"

function head() {
  return (
    <div className="head">
      <img src={logo} />
      <Heading name="Terahertz photonics and plasmonics laboratory" />
    </div>
  );
}

export default head;
